PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(80) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"));
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "group_id" integer NOT NULL REFERENCES "auth_group" ("id"));
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"));
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id"), "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id"), "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "first_name" varchar(30) NOT NULL, "last_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "username" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "dsa_starter_race" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" text NOT NULL);
CREATE TABLE IF NOT EXISTS "dsa_starter_actualskill" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "value" smallint NOT NULL, "skill_id" integer NOT NULL REFERENCES "dsa_starter_skill" ("id"), "character_id" integer NOT NULL REFERENCES "dsa_starter_character" ("id"));
CREATE TABLE IF NOT EXISTS "dsa_starter_skillgroup" ("name" varchar(1) NOT NULL, "cost_per_increase" smallint NOT NULL, "title" varchar(50) NOT NULL, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "dsa_starter_skilltype" ("skill_group_id" integer NOT NULL REFERENCES "dsa_starter_skillgroup" ("id"), "name" varchar(50) NOT NULL, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "dsa_starter_skill" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "type_id" integer NOT NULL REFERENCES "dsa_starter_skilltype" ("id"), "behinderung" varchar(4) NOT NULL, "dice1" varchar(2) NOT NULL, "dice2" varchar(2) NOT NULL, "dice3" varchar(2) NOT NULL, "basis" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "dsa_starter_weaponskilldistribution" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "character_id" integer NOT NULL REFERENCES "dsa_starter_character" ("id"), "skill_id" integer NOT NULL REFERENCES "dsa_starter_skill" ("id"), "attack" smallint NOT NULL, "parade" smallint NOT NULL);
CREATE TABLE IF NOT EXISTS "dsa_starter_nonplayercharacter" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "gender" varchar(1) NOT NULL, "avatar" varchar(100) NULL, "avatar_small" varchar(100) NULL, "name" varchar(200) NOT NULL, "iniitiative" smallint NOT NULL, "attack" smallint NOT NULL, "parade" smallint NOT NULL, "hit_points" varchar(6) NOT NULL, "race_id" integer NOT NULL REFERENCES "dsa_starter_race" ("id"), "type_id" integer NOT NULL REFERENCES "dsa_starter_herotype" ("id"));
CREATE TABLE IF NOT EXISTS "dsa_starter_fight" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "adventure_id" integer NOT NULL REFERENCES "dsa_starter_adventure" ("id"));
CREATE TABLE IF NOT EXISTS "dsa_starter_characterhasweapon" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "character_id" integer NOT NULL REFERENCES "dsa_starter_character" ("id"), "weapon_id" integer NOT NULL REFERENCES "dsa_starter_weapon" ("id"));
CREATE TABLE IF NOT EXISTS "dsa_starter_weapon" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "hit_dices" smallint NOT NULL, "hit_add_points" smallint NOT NULL, "skill_type_id" integer NOT NULL REFERENCES "dsa_starter_skill" ("id"));
CREATE TABLE IF NOT EXISTS "dsa_starter_fightcharacterparticipation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "character_id" integer NOT NULL REFERENCES "dsa_starter_character" ("id"), "fight_id" integer NOT NULL REFERENCES "dsa_starter_fight" ("id"), "position" varchar(1) NOT NULL);
CREATE TABLE IF NOT EXISTS "dsa_starter_adventure" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "isActive" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "dsa_starter_adventureimage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "caption" varchar(200) NOT NULL, "adventure_id" integer NOT NULL REFERENCES "dsa_starter_adventure" ("id"), "image" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "dsa_starter_character" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created_date" datetime NOT NULL, "name" varchar(200) NOT NULL, "type_id" integer NOT NULL REFERENCES "dsa_starter_herotype" ("id"), "race_id" integer NOT NULL REFERENCES "dsa_starter_race" ("id"), "experience" smallint NOT NULL, "life" smallint NOT NULL, "charisma" smallint NOT NULL, "culture" varchar(200) NOT NULL, "fingerfertigkeit" smallint NOT NULL, "gender" varchar(1) NOT NULL, "gewandheit" smallint NOT NULL, "intuition" smallint NOT NULL, "klugheit" smallint NOT NULL, "koerperkraft" smallint NOT NULL, "konstitution" smallint NOT NULL, "mut" smallint NOT NULL, "size" smallint NOT NULL, "social_rank" smallint NOT NULL, "experience_used" smallint NOT NULL, "ini_basis" smallint NOT NULL, "life_lost" smallint NOT NULL, "avatar" varchar(100) NULL, "avatar_small" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE `dsa_starter_points_spent` (
	`hero_id`	INTEGER NOT NULL,
	`points_spent`	INTEGER NOT NULL,
	`activity_json`	TEXT NOT NULL
);
CREATE TABLE `dsa_starter_abenteuer_punkte` (
	`hero_id`	INTEGER NOT NULL,
	`abenteuer_punkte`	INTEGER NOT NULL DEFAULT (0)
);
CREATE TABLE IF NOT EXISTS "dsa_starter_nonplayercharacterhasweapon" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "character_id" integer NOT NULL REFERENCES "dsa_starter_nonplayercharacter" ("id"), "weapon_id" integer NOT NULL REFERENCES "dsa_starter_weapon" ("id"));
CREATE TABLE IF NOT EXISTS "dsa_starter_spelltype" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "dsa_starter_spell" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "dice1" varchar(2) NOT NULL, "dice2" varchar(2) NOT NULL, "dice3" varchar(2) NOT NULL, "basis" bool NOT NULL, "type_id" integer NOT NULL REFERENCES "dsa_starter_spelltype" ("id"));
CREATE TABLE IF NOT EXISTS "dsa_starter_herotype" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "knowsMagic" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "dsa_starter_actualspellskill" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "value" smallint NOT NULL, "character_id" integer NOT NULL REFERENCES "dsa_starter_character" ("id"), "spell_id" integer NOT NULL REFERENCES "dsa_starter_spell" ("id"));
